 3.	(QueryExamList)讀取考試清單
(1)	傳入參數：考試方式(A-初選; B-複選)
(2)	處理方式：依Current.ExamYear至考試基本資料設定[ExamBase] 且SchType = 傳入參數，取得考試清單
(3) 回傳資料：考試代碼、考試名稱、考試狀態、考試日期起迄。
 
 考試方式
 考試代碼、考試名稱、考試狀態、考試日期起迄。
